// src/pages/Donate.jsx
function Donate() {
  return (
    <section className="container">
      <h1 className="page-title">Faire un don</h1>
      <p>
        Grâce à vos dons, Les Colis du Cœur peuvent financer l&apos;achat de
        denrées alimentaires, de produits d&apos;hygiène et de matériel pour
        aider les personnes les plus vulnérables.
      </p>
      <p>
        (Ici, on intégrera prochainement les boutons / liens vers ta solution
        de paiement : HelloAsso, virement, chèque, etc.)
      </p>
    </section>
  );
}

export default Donate;
